import KeeperTable from "./components/KeeperTable";
import { useState } from "react";

const App = () => {
  const [selectedYear, setSelectedYear] = useState("");
  const [selectedTeam, setSelectedTeam] = useState("");

  const handleYearChange = () => {
    setSelectedYear(document.getElementById("ft-year-select").value);
    setSelectedTeam(document.getElementById("ft-team-select").value);
  };
  return (
    <div>
      <select onChange={handleYearChange} id="ft-year-select">
        <option default value="#">
          Select a Year
        </option>
        <option default value="2020">
          2020
        </option>
        <option default value="2021">
          2021
        </option>
      </select>
      <select id="ft-team-select">
        <option default value="#">
          Select a Team
        </option>
        <option default value="BillDaly">
          Bill Daly
        </option>
        <option default value="PopMachine">
          Pop Machine
        </option>
        <option default value="Heboshabs">
          Hebos Habs
        </option>
      </select>
      <button>Click Me</button>
      <KeeperTable yearSearch={selectedYear} teamSearch={selectedTeam} />
    </div>
  );
};

export default App;
